import React from "react";
import Room from "./Room";
import Axios from "axios";
const RoomsList = ({ rooms, props }) => {
  var niz=[];
  Axios.get("http://localhost:3001/raspoloziveSobe", 
  {
    start_date : new Intl.DateTimeFormat('en-US', {year: 'numeric', month: '2-digit',day: '2-digit', hour: '2-digit', minute: '2-digit', second: '2-digit'}).format(props.startDate),
    end_date : new Intl.DateTimeFormat('en-US', {year: 'numeric', month: '2-digit',day: '2-digit', hour: '2-digit', minute: '2-digit', second: '2-digit'}).format(props.endDate)
  }).then((result)=>{
    niz=result.map(sobe=>{
      return sobe.id;
    })
    alert("successfully filtered rooms!");
  });
  if (rooms.length === 0) {
    return (
      <div className="empty-search">
        <h3>Na≈æalost nema soba koje zadovoljavaju date kriterije</h3>
      </div>
    );
  }
  console.log(props);
  return (
    <section className="roomslist">
      <div className="roomslist-center">
        {rooms.map(item => {
          niz.map(id=>{
            if(id==item.id) return <Room props={props} key={item.id} room={item} />;
          })
          
        })}
      </div>
    </section>
  );
};

export default RoomsList;
